import React from 'react';
import s from "./Post.module.css";

const Post = (props) => {
    return (
        <div className={s.item}>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSAtUWTJzEffdOWDHzAh_O-gGUe33pWc1f5inWM01qE-_GstFS7" />
            <h5>{props.message}</h5>
    <p>Like's {props.like}</p>
        </div>
    );
}

export default Post;
